import styled from 'styled-components'

const StyledNav = styled.nav`
    color: blue;
`;

const Nav = () => {
    return (
        <StyledNav>
            <ul>
                <li>Sizing</li>
                <li>On Hold</li>
                <li>Archive</li>
            </ul>
        </StyledNav>
    )
}

export default Nav
